import React, { useState } from "react";

const Cell = (props) => {
  let [count, setCount] = useState(0);
  function handleClick() {
    return setCount((count) => {
      return count++;
    });
  }
  return (
    <div className="game-cell" onClick={props.onClick}>
      {props.value}

      <div onClick={handleClick}>Click {count}</div>
    </div>
  );
};

export default Cell;
